INSERT INTO `tickets` VALUES (3,'henrique','Tenho um problema com os dados da minha conta','dasd','27/11/2022 21:08:22',NULL,NULL,NULL),(4,'henrique','Tenho um problema com os dados da minha conta','dasd','27/11/2022 21:09:10',NULL,NULL,NULL),(10,'henrique','Tenho um problema com as opções de pagamento','dasda','27/11/2022 23:36:58','gus','nao to nem ai bixo','27/11/2022 23:41:20'),(11,'Gustavo','Encontrei um problema no sistema da Locacar','o botaozinho de trocar tipo de login (funcionario/cliente) não está acessível a pessoas com parkinson\r\n','29/11/2022 11:21:14','infDiretor','Olá Davi! Agradecemos o seu contato.\nEstamos satisfeitos pelo seu retorno, entretanto preciso dizer que nossa equipe desenvolvedora não se importa com os clientes, apenas com o dinheiro caindo na conta da empresa no final do mês. Vá se foder com muito amor :)\nDesejamos um bom uso de nossa plataforma. ','29/11/2022 11:24:31'),(12,'lucaosupino','Tenho um problema com as opções de pagamento','cade o BOLETO BANCARIO','29/11/2022 22:33:13',NULL,NULL,NULL),(13,'henrique','AVISO DA MICROSOFT: Iremos te processar','Hello I am Bill gates and i gonna process you. Good luck','30/11/2022 06:28:20',NULL,NULL,NULL),(14,'Gustavo','Não consigo alugar um veículo','Olá! Tentei alugar um veículo, porém deu pagamento recusado. Ok que eu não dinheiro, mas gostaria de alugar do mesmo jeito seus bando de incompetendes capistalista!!!! Isso é tudo culpa do Lula!','30/11/2022 08:44:15',NULL,NULL,NULL),(15,'Gustavo','Não consigo alugar um veículo','Olá! Tentei alugar um veículo, porém deu pagamento recusado. Ok que eu não dinheiro, mas gostaria de alugar do mesmo jeito seus bando de incompetendes capistalista!!!! Isso é tudo culpa do Lula!','30/11/2022 08:45:50','gus','Fodase! O problema é seu meu caro amigo pobre!','30/11/2022 08:47:45'),(16,'sallum','Não consigo alugar um veículo','Olá queridos funcionários! Eu fui até a unidade da Av. Amazonas e o gerente responsável me informou que o pagamento via carteirinha do CEFET-MG não era aceita! UM ABSURDO!! IREI PROCESSAR ESSA EMPRESA!!','30/11/2022 09:14:45','gus','Olá querido cliente Sallum. O problema é seu! Resolva isso entre você e você mesmo, seu pobre! Atenciosamente, Locacar Veículos','30/11/2022 09:16:08');
